  - uid: '@azure/cognitiveservices-face.FaceListOperations.create'
    name: 'create(string, Models.FaceListCreateOptionalParams)'
    children: []
    type: method
    langs:
      - typeScript
    summary: "Créer une liste vide face faceListId spécifié par l’utilisateur, nom et un userData facultatif et recognitionModel. Jusqu'à 64 visages listes sont autorisées dans un seul abonnement.\n<br /> Liste de face est une liste de visages, jusqu'à 1 000 visages et utilisé par [Face - Rechercher similaire](/docs/services/563879b61984550e40cbbe8d/operations/563879b61984550f30395237).\n<br /> Après la création, l’utilisateur doit utiliser [FaceList - ajouter un visage](/docs/services/563879b61984550e40cbbe8d/operations/563879b61984550f30395250) pour importer les visages. Visages stockés sur le serveur jusqu'à ce que [FaceList - Delete](/docs/services/563879b61984550e40cbbe8d/operations/563879b61984550f3039524f) est appelée.\n<br /> Rechercher que similaire est utilisée pour le scénario de recherche de visages similaires de célébrités, face similaire au filtrage, ou comme un voyant fait face d’identification. Mais si l’utilisation réelle consiste à identifier la personne, veuillez utiliser [groupe de personnes](/docs/services/563879b61984550e40cbbe8d/operations/563879b61984550f30395244) /\n[LargePersonGroup](/docs/services/563879b61984550e40cbbe8d/operations/599acdee6ac60f11b48b5a9d) et [doivent faire Face\_: identifier](/docs/services/563879b61984550e40cbbe8d/operations/563879b61984550f30395239).\n<br /> Pensez à [LargeFaceList](/docs/services/563879b61984550e40cbbe8d/operations/5a157b68d2de3616c086f2cc) lorsque le nombre de visage est volumineux. Il peut prendre en charge jusqu'à 1 000 000 visages. 'recognitionModel' doit être spécifié à associer à cette liste de visages. La valeur par défaut pour 'recognitionModel' est 'recognition_01', si le dernier modèle nécessaire, veuillez spécifier explicitement le modèle que vous avez besoin dans ce paramètre. Nouvelles faces qui sont ajoutés à une liste existante de la face utilisera le modèle de reconnaissance qui a déjà associé à la collection. Fonctionnalités existantes de visage dans une liste de face ne peut pas être mis à jour aux fonctionnalités extraites par une autre version de modèle de reconnaissance."
    syntax:
      content: 'function create(faceListId: string, options?: Models.FaceListCreateOptionalParams)'
      parameters:
        - id: faceListId
          type:
            - string
          description: ID faisant référence à une liste de visages particulier.
        - id: options
          type:
            - Models.FaceListCreateOptionalParams
          description: ''
          optional: true
      return:
        type:
          - Promise<RestResponse>
    package: '@azure/cognitiveservices-face'
